import logo from './logo.svg';
import './App.css';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import GetTables from './menu'
function App() {
  return (
    <div>
      <BrowserRouter>
      <Routes>

      <Route  path='/tables' element={<GetTables/>}/>
      </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
